DROP TABLE IF EXISTS casda.atlas_continuum_source ;

CREATE TABLE casda.atlas_continuum_source  (  
 source_ident             VARCHAR(4), -- Component number
 source_name             VARCHAR(26), -- Designation for the radio component
 cid                     VARCHAR(26), -- Component number corresponding to Table 4
 swire_name              VARCHAR(26), -- SWIRE designated name
 ra_h                            INT, -- Hour of Right Ascension (J2000)
 ra_m                            INT, -- Minute of Right Ascension (J2000)
 ra_s                           REAL, -- Second of Right Ascension (J2000)
 dec_sign                 VARCHAR(1), -- Sign of the Declination (J2000)
 dec_deg                         INT, -- Degree of Declination (J2000)
 dec_arcmin                      INT, -- Arcminute of Declination (J2000)
 dec_arcsec                     REAL, -- Arcsecond of Declination (J2000)
 ra_hms_cont             VARCHAR(20), -- J2000 right ascension (hh:mm:ss.sss)
 dec_dms_cont            VARCHAR(20), -- J2000 declination (dd:mm:ss.ss)
 ra_deg_cont        DOUBLE PRECISION, -- J2000 right ascension in decimal degrees
 dec_deg_cont       DOUBLE PRECISION, -- J2000 declination in decimal degrees
 flux_20cm                      REAL, -- Total 20 cm flux density
 flux_3_6micron                 REAL, -- The 3.6 micron flux density
 flux_4_5micron                 REAL, -- The 4.5 micron flux density
 flux_5_8micron                 REAL, -- The 5.8 micron flux density
 flux_8_0micron                 REAL, -- The 8.0 micron flux density
 flux_24micron                  REAL, -- The 24 micron flux density
 umag                           REAL, -- SDSS u' band (Vega) magnitude
 gmag                           REAL, -- SDSS g' band (Vega) magnitude
 rmag                           REAL, -- SDSS r' band (Vega) magnitude
 imag                           REAL, -- SDSS i' band (Vega) magnitude
 zmag                           REAL, -- SDSS z' band (Vega) magnitude
 redshift                       REAL, -- Spectroscopic redshift
 type                            INT, -- Identification type given in Table 5
 class                    VARCHAR(3), -- Classification based on Section 3.4 criteria
 basis_class              VARCHAR(3), -- Basis for class 
 comment             VARCHAR(232) ) ; -- Additional comments

COMMENT ON COLUMN casda.atlas_continuum_source.source_ident IS 'Component number';
COMMENT ON COLUMN casda.atlas_continuum_source.source_name IS 'Designation for the radio component';
COMMENT ON COLUMN casda.atlas_continuum_source.cid IS 'Component number corresponding to Table 4';
COMMENT ON COLUMN casda.atlas_continuum_source.swire_name IS 'SWIRE designated name';
COMMENT ON COLUMN casda.atlas_continuum_source.ra_h IS 'Hour of Right Ascension (J2000)';
COMMENT ON COLUMN casda.atlas_continuum_source.ra_m IS 'Minute of Right Ascension (J2000)';
COMMENT ON COLUMN casda.atlas_continuum_source.ra_s IS 'Second of Right Ascension (J2000)';
COMMENT ON COLUMN casda.atlas_continuum_source.dec_sign IS 'Sign of the Declination (J2000)';
COMMENT ON COLUMN casda.atlas_continuum_source.dec_deg IS 'Degree of Declination (J2000)';
COMMENT ON COLUMN casda.atlas_continuum_source.dec_arcmin IS 'Arcminute of Declination (J2000)';
COMMENT ON COLUMN casda.atlas_continuum_source.dec_arcsec IS 'Arcsecond of Declination (J2000)';
COMMENT ON COLUMN casda.atlas_continuum_source.ra_hms_cont IS 'J2000 right ascension (hh:mm:ss.sss)';
COMMENT ON COLUMN casda.atlas_continuum_source.dec_dms_cont IS 'J2000 declination (dd:mm:ss.ss)';
COMMENT ON COLUMN casda.atlas_continuum_source.ra_deg_cont IS 'J2000 right ascension in decimal degrees';
COMMENT ON COLUMN casda.atlas_continuum_source.dec_deg_cont IS 'J2000 declination in decimal degrees';
COMMENT ON COLUMN casda.atlas_continuum_source.flux_20cm IS 'Total 20 cm flux density';
COMMENT ON COLUMN casda.atlas_continuum_source.flux_3_6micron IS 'The 3.6 micron flux density';
COMMENT ON COLUMN casda.atlas_continuum_source.flux_4_5micron IS 'The 4.5 micron flux density';
COMMENT ON COLUMN casda.atlas_continuum_source.flux_5_8micron IS 'The 5.8 micron flux density';
COMMENT ON COLUMN casda.atlas_continuum_source.flux_8_0micron IS 'The 8.0 micron flux density';
COMMENT ON COLUMN casda.atlas_continuum_source.flux_24micron IS 'The 24 micron flux density';
COMMENT ON COLUMN casda.atlas_continuum_source.umag IS 'SDSS u'' band (Vega) magnitude';
COMMENT ON COLUMN casda.atlas_continuum_source.gmag IS 'SDSS g'' band (Vega) magnitude';
COMMENT ON COLUMN casda.atlas_continuum_source.rmag IS 'SDSS r'' band (Vega) magnitude';
COMMENT ON COLUMN casda.atlas_continuum_source.imag IS 'SDSS i'' band (Vega) magnitude';
COMMENT ON COLUMN casda.atlas_continuum_source.zmag IS 'SDSS z'' band (Vega) magnitude';
COMMENT ON COLUMN casda.atlas_continuum_source.redshift IS 'Spectroscopic redshift';
COMMENT ON COLUMN casda.atlas_continuum_source.type IS 'Identification type given in Table 5';
COMMENT ON COLUMN casda.atlas_continuum_source.class IS 'Classification based on Section 3.4 criteria';
COMMENT ON COLUMN casda.atlas_continuum_source.basis_class IS 'Basis for class'; 
COMMENT ON COLUMN casda.atlas_continuum_source.comment IS 'Additional comments' ;
COMMENT ON TABLE casda.atlas_continuum_source IS 'Deep ATLAS radio observations of the CDFS-SWIRE field';

